import Header from "../componants/header"
import Registration from "../componants/registration"

const Registrationpage = (data)=>{
    return(
        <>
            {<Header/>}
            {<Registration data={data.commonData.api_url}/>}
          
        </>
    )
}
export default Registrationpage
